import { FormControl, Grid } from "@mui/material";
import ProductCard from "../productCard/productCard.component";

const ProductGrid = ({formData, setFormData}) => {
      return(
            <FormControl>
            <Grid container spacing={3}>
                  <Grid item xs={4}>
                        <ProductCard title="Same Size" productName="sameSize" formData={formData} setFormData={setFormData}/>
                  </Grid>
                  <Grid item xs={4}>
                        <ProductCard title="SoÃ±ados" productName="sonados" formData={formData} setFormData={setFormData}/>
                  </Grid>
                  <Grid item xs={4}>
                        <ProductCard title="Mix" productName="mix" formData={formData} setFormData={setFormData}/>
                  </Grid>
            </Grid>
            </FormControl>
      );
}

export default ProductGrid;
